import React from 'react';
import { Link } from '@reach/router';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import LogoWhite from '../img/logo-white.png';

import '../css/LandingNavbar.css';

const LandingNavbar = () => {
	return (
		<Navbar
			bg="transparent"
			expand="lg"
			style={style.SiteNav}
			className="landing-navbar"
		>
			<Navbar.Brand href="/">
				<img src={LogoWhite} alt="logo white" style={style.Logo} />
			</Navbar.Brand>
			<Navbar.Toggle aria-controls="basic-navbar-nav" />
			<Navbar.Collapse id="basic-navbar-nav">
				<Nav className="mr-auto">
					<a href="/" className="link-tag">
						<p style={style.NavText}>Home</p>
					</a>
					<a href="/about" className="link-tag">
						<p style={style.NavText}>About</p>
					</a>
					<a href="/team" className="link-tag">
						<p style={style.NavText}>Team</p>
					</a>
					<a href="/projects" className="link-tag">
						<p style={style.NavText}>Projects</p>
					</a>
					<a href="/apply" className="link-tag">
						<p style={style.NavText}>Apply</p>
					</a>
				</Nav>
			</Navbar.Collapse>
		</Navbar>
	);
};

const style = {
	SiteNav: {
		padding: '8vh 0 0 7%',
	},
	Logo: {
		marginRight: '1.5rem',
		width: '100px',
	},
	NavText: {
		fontSize: '22px',
		color: 'white',
		margin: '0 1rem',
		letterSpacing: '0.11em',
		textTransform: 'uppercase',
	},
};

export default LandingNavbar;
